
////////////////////////////////////////////////////////////////////////////////
// ABSTRACT: Error Detection & Correction
//
//  Parameters:     Valid Values    Description
//  ==========      ============    =============
//  width             8 to 8178     default: 
//                                  Width of 'datain' and 'dataout'
//
//  chkbits            5 to 14      default:
//                                  Width of 'chkin' and 'chkout'
//
//  synd_sel           0 to 1       default:
//                                  Selection of checkbit correction of syndrome
//
//
//  Ports        Size    Direction    Description
//  =====        ====    =========    ===========
//  gen          1 bit     Input      Controls whether output check bits, chkout,
//                                    are generated from data input bits, datain,
//                                    or they are derived from input check bits,
//                                    chkin (with possible correction applied)
//  correct_n    1 bit     Input      Input control signal indicating whether or not to correct
//  datain       M bits    Input      Input data bus
//  chkin        N bits    Input      Input check bits bus
//
//  dataout      M bits    Output     Output data bus
//  chkout       N bits    Output     Output check bits bus
//  err_multpl   1 bit     Output     Flag indicating multibit (i.e. uncorrectable) error
//  err_detect   1 bit     Output     Flag indicating occurance of error
//
//     Note: M is the value of "width" parameter
//     Note: N is the value of "chkbits" parameter
//
// MODIFIED:
//
//
////////////////////////////////////////////////////////////////////////////////

module DW_ecc(
        gen,            // Write or read mode selection
        correct_n,      // Select corrected results or not
        datain,         // Input data bus
        chkin,          // Input check bits bus (for read or scrub)

        err_detect,     // Any error flag (active high)
        err_multpl,     // Multiple bit error flag (active high)
        dataout,        // Output data bus
        chkout          // Output check bits bus
//  set_local_link_library { "dw_foundation.sldb" }
// _model_constraint_1
//  set_attribute _current_design "enable_dp_opt" "TRUE" -type "boolean" -quiet
//  _if_find( '"cell"', '"U_DECODER"' )  {
//    set_ungroup _find( '"cell"', '"U_DECODER"' ) "true"
//  }
//  _if_find( '"cell"', '"U_PAR_GEN*"' )  {
//    set_ungroup _find( '"cell"', '"U_PAR_GEN*"' ) "true"
//  }
//
	);

parameter width = 8;     // RANGE 8 to 8178
parameter chkbits = 5;   // RANGE 5 to 14
parameter synd_sel = 0;  // RANGE 0 to 1

`define DW_max_data_width ((chkbits==5)?11:(chkbits==6)?26:(chkbits==7)?57:(chkbits==8)?120:(chkbits==9)?247:(chkbits==10)?502:(chkbits==11)?1013:(chkbits==12)?2036:(chkbits==13)?4083:8178)
`define DW_BlkSize     512
`define DW_BlkSizeM1   (`DW_BlkSize-1)
`define DW_BlkCnt      (`DW_max_data_width / `DW_BlkSize)

input                         gen;           // Write vs. Read mode
input                         correct_n;     // Select corrected results or not
input  [width-1:0]            datain;        // Data input
input  [chkbits-1:0]          chkin;         // Check bits input

output                        err_detect;    // Error detect output
output                        err_multpl;    // Multiple errors detected output
output [width-1:0]            dataout;       // Data output
output [chkbits-1:0]          chkout;        // Check bits output

wire  [`DW_max_data_width:0]  syndec;
reg   [`DW_max_data_width:0]  dat_in;
wire  [chkbits-1:0]           chkout_int;
wire  [chkbits-1:0]           syndout_int;
wire  [width-1:0]             fixdata;
wire  [chkbits-1:0]           fixchk;

wire  [width-1:0]             dataout_rd_mode;
wire  [chkbits-1:0]           chkout_rd_mode;
wire  [chkbits-1:0]           syndout_rd_mode;
wire                          err_detect_rd_mode;
wire                          err_multpl_rd_mode;

//######################### Beginning of ECC logic #####################################
generate
  case (chkbits)
    default: begin : GEN_CB_DEFAULT
      function FUNC_or_tree_chkbits5;
        input  [4:0]     a;
        reg    [8:0]      vec;
        integer  i;
        begin
          // Assign input vector to lower half of vec[]
          for (i=0; i<5; i=i+1) begin
            vec[i] = a[i];
          end  // loop
          // Produce OR reduction tree
          for (i=0; i<4; i=i+1) begin
            vec[5+i] = vec[2*i] | vec[(2*i)+1];
          end  // loop
          FUNC_or_tree_chkbits5 = vec[8];
        end
      endfunction // FUNC_or_tree_chkbits5


      function FUNC2_or_tree_chkbits5;
        input  [11+5:0]     a;
        reg    [(2*(width+5))-2:0]      vec;
        integer  i;
        begin
          // Assign input vector to lower half of vec[]
          for (i=0; i<width+5; i=i+1) begin
            vec[i] = a[i];
          end  // loop
          // Produce OR reduction tree
          for (i=0; i<width+5-1; i=i+1) begin
            vec[width+5+i] = vec[2*i] | vec[(2*i)+1];
          end  // loop
          FUNC2_or_tree_chkbits5 = vec[(2*(width+5))-2];
        end
      endfunction // FUNC2_or_tree_chkbits5


      DW04_par_gen #(7, 1) U_PAR_GEN_0 (
                      .datain({ dat_in[10], dat_in[9], dat_in[8], dat_in[5],
                                dat_in[3], dat_in[2], dat_in[1] }),
                      .parity(chkout_int[0])
                     );

      DW04_par_gen #(7, 1) U_PAR_GEN_1 (
                      .datain({ dat_in[10], dat_in[8], dat_in[6], dat_in[4],
                                dat_in[2], dat_in[1], dat_in[0] }),
                      .parity(chkout_int[1])
                     );

      DW04_par_gen #(7, 1) U_PAR_GEN_2 (
                      .datain({ dat_in[10], dat_in[9], dat_in[8], dat_in[7],
                                dat_in[4], dat_in[3], ~dat_in[0] }),
                      .parity(chkout_int[2])
                     );

      DW04_par_gen #(7, 1) U_PAR_GEN_3 (
                      .datain({ dat_in[9], dat_in[8], dat_in[7], dat_in[6],
                                dat_in[5], dat_in[1], ~dat_in[0] }),
