          end  // loop
          // Produce OR reduction tree
          for (i=0; i<5; i=i+1) begin
            vec[6+i] = vec[2*i] | vec[(2*i)+1];
          end  // loop
          FUNC_or_tree_chkbits6 = vec[10];
        end
      endfunction // FUNC_or_tree_chkbits6


      function FUNC2_or_tree_chkbits6;
        input  [26+6:0]     a;
        reg    [(2*(width+6))-2:0]      vec;
        integer  i;
        begin
          // Assign input vector to lower half of vec[]
          for (i=0; i<width+6; i=i+1) begin
            vec[i] = a[i];
          end  // loop
          // Produce OR reduction tree
          for (i=0; i<width+6-1; i=i+1) begin
