      DW04_par_gen #(15, 1) U_PAR_GEN_4 (
                      .datain({ dat_in[24], dat_in[23], dat_in[22], dat_in[21],
                                dat_in[20], dat_in[19], dat_in[16], dat_in[15],
                                dat_in[14], dat_in[7], dat_in[6], dat_in[5],
                                dat_in[4], dat_in[3], dat_in[2] }),
                      .parity(chkout_int[4])
