      wire  [(1<<chkbits)-1:0]  s_decoded;

      DW01_decode #(chkbits) U_DECODER (
             .A(syndout_int),
             .B(s_decoded)
             );

      assign syndec[0] = s_decoded[14];
      assign syndec[1] = s_decoded[11];
      assign syndec[2] = s_decoded[19];
      assign syndec[3] = s_decoded[21];
      assign syndec[4] = s_decoded[22];
      assign syndec[5] = s_decoded[25];
      assign syndec[6] = s_decoded[26];
      assign syndec[7] = s_decoded[28];
      assign syndec[8] = s_decoded[35];
      assign syndec[9] = s_decoded[37];
      assign syndec[10] = s_decoded[38];
      assign syndec[11] = s_decoded[41];
      assign syndec[12] = s_decoded[42];
      assign syndec[13] = s_decoded[44];
      assign syndec[14] = s_decoded[49];
      assign syndec[15] = s_decoded[52];
      assign syndec[16] = s_decoded[31];
      assign syndec[17] = s_decoded[13];
      assign syndec[18] = s_decoded[7];
      assign syndec[19] = s_decoded[62];
      assign syndec[20] = s_decoded[61];
      assign syndec[21] = s_decoded[59];
      assign syndec[22] = s_decoded[56];
      assign syndec[23] = s_decoded[55];
      assign syndec[24] = s_decoded[50];
      assign syndec[25] = s_decoded[47];
      assign syndec[26] = 1'b0;
      assign fixchk[0] = s_decoded[1];
      assign fixchk[1] = s_decoded[2];
      assign fixchk[2] = s_decoded[4];
      assign fixchk[3] = s_decoded[8];
      assign fixchk[4] = s_decoded[16];
      assign fixchk[5] = s_decoded[32];

// Fill internal data input up to maximum encodings +1 extra bit
      always @ (datain) begin : INT_DATA1
        integer  i;

        for (i=0; i<=`DW_max_data_width; i=i+1) begin
          if (i < width)
            dat_in[i] = datain[i];
          else
            dat_in[i] = 1'b0;
        end  // for-loop 'i'
      end // of always

// Rest of the logic for error flags, syndrome, and fix data and chk bits
      assign syndout_int = chkout_int ^ chkin;

      assign err_detect_rd_mode = FUNC_or_tree_chkbits6(syndout_int);

      assign err_multpl_rd_mode = err_detect_rd_mode & ( ~(FUNC2_or_tree_chkbits6({syndec, fixchk})) );

      assign fixdata = syndec[width-1:0];

      assign chkout_rd_mode = chkin ^ fixchk;

      assign dataout_rd_mode = datain ^ fixdata;

      assign syndout_rd_mode = syndout_int;

    end // chkbits of 6

    7: begin : GEN_CB_7
      function FUNC_or_tree_chkbits7;
        input  [6:0]     a;
        reg    [12:0]      vec;
        integer  i;
        begin
          // Assign input vector to lower half of vec[]
          for (i=0; i<7; i=i+1) begin
