          end  // loop
          FUNC2_or_tree_chkbits7 = vec[(2*(width+7))-2];
        end
      endfunction // FUNC2_or_tree_chkbits7


      DW04_par_gen #(31, 1) U_PAR_GEN_0 (
                      .datain({ dat_in[56], dat_in[54], dat_in[52], dat_in[49],
                                dat_in[48], dat_in[47], dat_in[46], dat_in[45],
                                dat_in[43], dat_in[41], dat_in[40], dat_in[38],
                                dat_in[37], dat_in[35], dat_in[33], dat_in[31],
                                dat_in[29], dat_in[28], dat_in[26], dat_in[21],
                                dat_in[19], dat_in[18], dat_in[17], dat_in[14],
                                dat_in[11], dat_in[9], dat_in[8], dat_in[7],
                                dat_in[6], dat_in[4], dat_in[0] }),
                      .parity(chkout_int[0])
                     );

      DW04_par_gen #(31, 1) U_PAR_GEN_1 (
                      .datain({ dat_in[55], dat_in[54], dat_in[53], dat_in[51],
