      DW04_par_gen #(31, 1) U_PAR_GEN_6 (
                      .datain({ dat_in[56], dat_in[55], dat_in[54], dat_in[53],
                                dat_in[52], dat_in[51], dat_in[50], dat_in[49],
                                dat_in[38], dat_in[37], dat_in[36], dat_in[35],
                                dat_in[34], dat_in[33], dat_in[32], dat_in[31],
